import { movies } from "../../data";

import "./styles.module.scss";

const Movies = () => {
  return (
    <div className="movies-container">
      <div className="movie-list">
        {movies &&
          movies.map(movie => {
            return <li>{movie.name}</li>;
          })}
      </div>
    </div>
  );
};

export default Movies;
